import React, { useState } from 'react';
import axios from 'axios';

const spinnerStyle = {
  display: 'inline-block',
  width: '32px',
  height: '32px',
  border: '4px solid #f3f3f3',
  borderTop: '4px solid #3498db',
  borderRadius: '50%',
  animation: 'spin 1s linear infinite',
  margin: '20px auto',
};

const ResumeUploader = () => {
  const [file, setFile] = useState(null);
  const [message, setMessage] = useState('');
  const [analysis, setAnalysis] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
    setMessage('');
    setAnalysis(null);
  };

  const handleUpload = async (e) => {
    e.preventDefault();
    if (!file) {
      setMessage('Please select a PDF file.');
      setAnalysis(null);
      return;
    }
    const formData = new FormData();
    formData.append('resume', file);
    setLoading(true);
    setMessage('');
    setAnalysis(null);
    try {
      const res = await axios.post('http://localhost:5000/upload', formData, {
        headers: { 'Content-Type': 'multipart/form-data' },
      });
      setMessage(res.data.message);
      setAnalysis(res.data.analysis || null);
    } catch (err) {
      setMessage(
        err.response?.data?.message || 'Upload failed. Please try again.'
      );
      setAnalysis(null);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{
      maxWidth: 600,
      margin: '40px auto',
      padding: 32,
      background: '#fff',
      borderRadius: 12,
      boxShadow: '0 2px 16px rgba(0,0,0,0.08)',
      fontFamily: 'Segoe UI, Arial, sans-serif',
    }}>
      <h2 style={{ textAlign: 'center', color: '#2c3e50', marginBottom: 24 }}>Resume Analyzer</h2>
      <form onSubmit={handleUpload} style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', gap: 16 }}>
        <label htmlFor="resume-upload" style={{
          padding: '24px 32px',
          border: '2px dashed #3498db',
          borderRadius: 8,
          background: '#f9f9f9',
          color: '#3498db',
          cursor: 'pointer',
          marginBottom: 8,
          width: '100%',
          textAlign: 'center',
          transition: 'background 0.2s',
        }}>
          {file ? file.name : 'Click or drag a PDF file here to upload'}
          <input
            id="resume-upload"
            type="file"
            accept="application/pdf"
            onChange={handleFileChange}
            style={{ display: 'none' }}
          />
        </label>
        <button
          type="submit"
          style={{
            background: '#3498db',
            color: '#fff',
            border: 'none',
            borderRadius: 6,
            padding: '10px 28px',
            fontSize: 16,
            fontWeight: 600,
            cursor: 'pointer',
            boxShadow: '0 1px 4px rgba(52,152,219,0.08)',
            marginTop: 8,
            transition: 'background 0.2s',
          }}
          disabled={loading}
        >
          {loading ? 'Uploading...' : 'Upload'}
        </button>
      </form>
      {loading && (
        <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', marginTop: 16 }}>
          <div style={spinnerStyle} />
          <style>{'@keyframes spin { 0% { transform: rotate(0deg); } 100% { transform: rotate(360deg); } }'}</style>
          <span style={{ color: '#888', marginTop: 8 }}>Analyzing your resume...</span>
        </div>
      )}
      {message && (
        <p style={{
          color: message.toLowerCase().includes('success') ? '#27ae60' : '#e74c3c',
          background: message.toLowerCase().includes('success') ? '#eafaf1' : '#fdecea',
          border: `1px solid ${message.toLowerCase().includes('success') ? '#b2f2bb' : '#f5c6cb'}`,
          borderRadius: 6,
          padding: '10px 16px',
          marginTop: 24,
          textAlign: 'center',
          fontWeight: 500,
        }}>{message}</p>
      )}
      {analysis && (
        <div style={{ marginTop: 32 }}>
          <h3 style={{ color: '#2c3e50', marginBottom: 12 }}>Resume Analysis Result</h3>
          <pre style={{
            textAlign: 'left',
            background: '#f4f4f4',
            padding: '1em',
            borderRadius: '5px',
            overflowX: 'auto',
            fontSize: 15,
            lineHeight: 1.5,
            boxShadow: '0 1px 4px rgba(44,62,80,0.04)',
          }}>
            {JSON.stringify(analysis, null, 2)}
          </pre>
        </div>
      )}
    </div>
  );
};

export default ResumeUploader;
